import { useState } from "react";
import {
  View,
  StyleSheet,
  FlatList,
  TouchableOpacity,
  Image,
  Text,
  TextInput,
} from "react-native";

export default function Books() {
  const [filter, setFilter] = useState("");
  const books = BOOKS.filter(
    (item) => item.title.toLowerCase().indexOf(filter.toLowerCase()) !== -1
  );
  return (
    <View>
      <View style={{ marginTop: 40, padding: 10 }}>
        <TextInput
          placeholder="Search"
          value={filter}
          onChangeText={(value) => setFilter(value)}
          style={{
            backgroundColor: "white",
            height: 50,
            fontSize: 20,
            padding: 10,
            borderRadius: 10,
          }}
        />
      </View>
      <View style={styles.container}>
        <View>
          <Text
            style={{ fontSize: 20, fontWeight: "500", textAlign: "center" }}
          >
            Books
          </Text>
        </View>
        <FlatList
          numColumns={3}
          data={books}
          renderItem={({ item }) => (
            <TouchableOpacity style={{ flex: 0.4, padding: 2 }}>
              <View>
                <Image
                  style={{
                    width: "100%",
                    height: 200,
                    overflow: "hidden",
                  }}
                  source={{
                    uri: item.src,
                  }}
                />
              </View>
              <View
                style={{
                  flex: 1,
                  justifyContent: "center",
                  alignItems: "center",
                  flexWrap: "wrap",
                }}
              >
                <Text> {item.title} </Text>
              </View>
            </TouchableOpacity>
          )}
          keyExtractor={(item) => item.id}
        />
      </View>
    </View>
  );
}

